import React from 'react';
import Layout from "../components/layout/index";

import ViewItemDetails from "../components/ViewItemDetails"

function ViewItemDetailsPage({ match }) {
  const { item_name } = match.params;

  return (
    <Layout
      body={<ViewItemDetails item_name={item_name}/>}
    />
  );
}

export default ViewItemDetailsPage;
